import React, { Component } from 'react'
import Navibar from "../Coponent/Navibar";

import { Link } from 'react-router-dom';

export default class Property extends Component {
    constructor(props) {
        super(props)
        this.state = {
            name: "",
            status: "",
            price: ""
        }
        this.onCheckChange = this.onCheckChange.bind(this);
        // this.handleChange = this.handleChange.bind(this);

    }
    getData(){
        fetch('http://127.0.0.1:8081/v2/room/supplier?sid=s01',{
            method:'GET'
        }).then(res => res.json()).then(
            data=>{
                this.setState({name: data,status : data,price : data})
            }
        )
    }

    onCheckChange(e) {
        console.log(e.target.checked);
        this.setState({
            [e.target.name]: e.target.checked
        })
    }

    handleInputChange = (event) => {
        event.preventDefault()
        this.setState({
            [event.target.name]: event.target.value
        })
    }
    handleChange(event){
        this.setState({type:event.target.value});
    }

    render() {
        return (
            <div className = "property">
                <Navibar loggedinstatus={this.props.loggedinstatus} />  
                <div className="property-container">
                    <h2>Your Property</h2>
                    <section className="property-section">

                        <div className="s_div">
                            <h3>Room 1</h3>
                            <div className="property-br">
                                Name
                            </div>
                            <div className="property-br">
                                Status
                            </div>
                            <div className="property-br">
                                Price
                            </div>
                            <button className="submit-pro" >Delete</button>
                            <button className="submit-pro">
                                <Link to='/host' className="modify">
                                    Modify
                                </Link>
                            </button>
                        </div>
                        <div className="s_div">
                            <h3>Room 2</h3>
                            <div className="property-br">
                                Name
                            </div>
                            <div className="property-br">
                                Status
                            </div>
                            <div className="property-br">
                                Price
                            </div>
                            <button className="submit-pro" >
                                Delete
                            </button>
                            <button className="submit-pro">
                                <Link to='/host' className="modify">
                                    Modify
                                </Link>
                            </button>
                        </div>
                        <div className="s_div">
                            <h3>Room 3</h3>
                            <div className="property-br">
                                Name
                            </div>
                            <div className="property-br">
                                Status
                            </div>
                            <div className="property-br">
                                Price
                            </div>
                            <button className="submit-pro" >
                                Delete
                            </button>
                            <button className="submit-pro">
                                <Link to='/host' className="modify">
                                    Modify
                                </Link>
                            </button>
                        </div>
                    </section>



                    <Link to='/host' className="btn-property">
                        Advertise your property
                    </Link>
                </div>
            </div>
        )
    }
}
